import { useNavigate } from 'react-router-dom';
import '../css/footer.css';
export function ChatBTN() {
  const navigate = useNavigate();

  const handleClick = () => {
    navigate('/Chatting'); 
  };

  return (
    <div class="floating-btn">
      <button class="chat" onClick={handleClick}>Chat</button>
    </div>
  );
}

export function HelpBTN() {
  const navigate = useNavigate();

  const handleClick = () => {
    navigate('/help');
  };

  return (
    <div class="floating-btn">
      <button class="help" onClick={handleClick}>Help</button>
    </div>
  );
}
